/* eslint-disable no-useless-constructor */
import React, { Component } from 'react'

class App extends Component {
  constructor(props)
  {
    super(props)
    this.state={
      name:"ram"
    }
  }

  clickHandler(){
    this.setState.name="l"
  }
  render() {
    return (
      <div style={{textAlign:"center"}}>
        <button onClick={this.clickHandler.bind(this)}>{this.state.name}</button>
      </div>
    )
  }
}

export default App
